package healthy.rim.type;import java.io.Serializable;import javax.xml.bind.annotation.XmlAccessType;import javax.xml.bind.annotation.XmlAccessorType;import javax.xml.bind.annotation.XmlElement;import javax.xml.bind.annotation.XmlRootElement;import javax.xml.bind.annotation.XmlType;/** * A telephone number (voice or fax), e-mail address, or other locator for a * resource (information or service) mediated by telecommunication equipment. * The address is specified as a URL qualified by time specification and use * codes that help in deciding which address to use for a given time and * purpose. * * @author Yosvany Llerena Rodr√≠guez <yosvanyllr@gmail.com> * @since 21-Jan-2013 */@XmlRootElement(name = "TEL")@XmlAccessorType(XmlAccessType.FIELD)@XmlType(name = "TEL", propOrder = {    "type",    "equipment",    "purpose",    "text",    "format",    "validTime"})public class TEL extends RimDataType {    @XmlElement(type = TelecomType.class, required = true)    private TelecomType type;    @XmlElement(type = TelecomEquipment.class, required = true)    private TelecomEquipment equipment;    @XmlElement(type = TelecomPurpose.class, required = true)    private TelecomPurpose purpose;    @XmlElement(required = true)    private String text = "";    @XmlElement    private String format = "";    @XmlElement(type = IVL.class)    private IVL<TS> validTime = new IVL<>(new TS(), new TS());    public TEL() {    }    public TEL(TelecomType type, TelecomEquipment equipment, TelecomPurpose purpose, String text,            String format, IVL<TS> validTime) {        this.type = type;        this.equipment = equipment;        this.purpose = purpose;        this.text = text;        this.format = format;        this.validTime = validTime;    }    public TelecomType getType() {        return type;    }    public void setType(TelecomType type) {        this.type = type;    }    public TelecomEquipment getEquipment() {        return equipment;    }    public void setEquipment(TelecomEquipment equipment) {        this.equipment = equipment;    }    public TelecomPurpose getPurpose() {        return purpose;    }    public void setPurpose(TelecomPurpose purpose) {        this.purpose = purpose;    }    public String getText() {        return text;    }    public void setText(String text) {        this.text = text;    }    public String getFormat() {        return format;    }    public void setFormat(String format) {        this.format = format;    }    public IVL<TS> getValidTime() {        return validTime;    }    public void setValidTime(IVL<TS> validTime) {        this.validTime = validTime;    }    @Override    public int hashCode() {        int hash = 3;        hash = 23 * hash + (this.type != null ? this.type.hashCode() : 0);        hash = 23 * hash + (this.equipment != null ? this.equipment.hashCode() : 0);        hash = 23 * hash + (this.purpose != null ? this.purpose.hashCode() : 0);        hash = 23 * hash + (this.text != null ? this.text.hashCode() : 0);        hash = 23 * hash + (this.format != null ? this.format.hashCode() : 0);        hash = 23 * hash + (this.validTime != null ? this.validTime.hashCode() : 0);        return hash;    }    @Override    public boolean equals(Object obj) {        if (obj == null) {            return false;        }        if (getClass() != obj.getClass()) {            return false;        }        final TEL other = (TEL) obj;        if (this.type != other.type) {            return false;        }        if (this.equipment != other.equipment) {            return false;        }        if (this.purpose != other.purpose) {            return false;        }        if ((this.text == null) ? (other.text != null) : !this.text.equals(other.text)) {            return false;        }        if ((this.format == null) ? (other.format != null) : !this.format.equals(other.format)) {            return false;        }        if (this.validTime != other.validTime && (this.validTime == null || !this.validTime.equals(other.validTime))) {            return false;        }        return true;    }    @Override    public String toString() {        return "TEL{" + "text=" + text + '}';    }}